swagger: "2.0"
info:
  version: "1.1.0.10"
  title: Solartis Rate with form selection API for STARR Commercial Auto
  description: To rate and produce the forms for a commercial auto policy per the inputs provided

host: starrca.rc.solartis.net
basePath: /DroolsV4_2/DroolsService
schemes:
  - https
consumes:
  - application/json  
produces:
  - application/json
paths:
  /FireEventV2:
    post:
      description: Gets Rates for Commercial Auto based on ISO ERC
      operationId: getRates
      produces:
        - application/json
      parameters:
        - name: Token
          in: header
          description: Authentication Token
          required: true
          type: string
          format: string
          default: ""
        - name: Content-Type
          in: header
          description: Content Type
          required: true
          type: string
          default: "application/json"
        - name: EventName
          in: header
          description: Name of the event to be invoked
          required: true
          type: string
          format: string
          default: "StarrCARate_1.1.0.10"
        - name: Rating Request
          in: body
          description: For rating request
          schema:
            $ref: "#/definitions/Rating_Request"
            
      responses:
       '200':
        description: Success Response
        schema:
         $ref: "#/definitions/Rating_Success_Response"
       default: 
        description: unexpected error
        schema:
          $ref: "#/definitions/errorModel"
